    public void WhiskeyMethod()
    {
      try
      {
        switch (Class1.WhiskeyTaskScriptStatus)
        {
          case 0:
            this.Bottle.IsVisible = false;
            this.Glass.IsVisible = false;
            Class1.WhiskeyTaskScriptStatus = 1;
            break;
