    public Color GetRandomMultiColour()
    {
      Color color = Color.Beige;
      int num = new System.Random().Next(1, 200);
      if (num > 0 && num < 10)
        color = Color.Blue;
      if (num > 10 && num < 20)
        color = Color.Yellow;
      if (num > 20 && num < 30)
        color = Color.Lime;
      if (num > 30 && num < 40)
        color = Color.Red;
      if (num > 40 && num < 50)
        color = Color.Orange;
      if (num > 50 && num < 60)
        color = Color.Pink;
      if (num > 60 && num < 70)
        color = Color.White;
      if (num > 70 && num < 80)
        color = Color.LightBlue;
      if (num > 80 && num < 90)
        color = Color.Magenta;
      if (num > 90 && num < 100)
        color = Color.OrangeRed;
      if (num > 100 && num < 110)
        color = Color.Green;
      if (num > 110 && num < 120)
        color = Color.YellowGreen;
      if (num > 120 && num < 130)
        color = Color.Violet;
      if (num > 130 && num < 140)
        color = Color.Cyan;
      if (num > 140 && num < 150)
        color = Color.SkyBlue;
      if (num > 150 && num < 160)
        color = Color.Silver;
      if (num > 160 && num < 170)
        color = Color.HotPink;
      if (num > 170 && num < 180)
        color = Color.DarkBlue;
      if (num > 180 && num < 190)
        color = Color.DarkRed;
      if (num > 190 && num < 200)
        color = Color.MidnightBlue;
      return color;
    }

